export function Validate(endpoint) {
  return (
    endpoint.interface === 2 &&
    endpoint.usage === 0x0001 &&
    endpoint.usage_page === 0xff00
  ) || (
      endpoint.interface === 0 &&
      endpoint.usage === 0x0004 &&
      endpoint.usage_page === 0x0001
    );
}
export function Render() {
  sendColors();
}

export function Shutdown() {
  sendColors(true);
}

export function ConflictingProcesses() {
  return ["HUD.exe"];
}

function hexToRgb(hex) {
  let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  let colors = [];
  colors[0] = parseInt(result[1], 16);
  colors[1] = parseInt(result[2], 16);
  colors[2] = parseInt(result[3], 16);

  return colors;
}

export function Image() {
  return "";
}

function sendColors(shutdown = false) {
  device.set_endpoint(0x02, 0x0001, 0xff00);
  const packet = [0x09, 0x00, 0x03];

  let rgb;

  if (shutdown) {
    rgb = hexToRgb(shutdownColor);
  } else if (LightingMode === "Forced") {
    rgb = hexToRgb(forcedColor);
  } else {
    rgb = device.color(0, 0);
  }
  packet.push(...rgb)
  device.send_report(packet, 64);

  device.set_endpoint(0x00, 0x0004, 0x0001);
  device.send_report([0x01, 0x01], 64);
}